import React from 'react'
import appIcon from "../../images/application-icon.png";
import blockChainIcon from "../../images/blockchain-black.png";
import "src/Components/Layout/IntroImage.scss";

const IntroImage = () => {
  return (
    <>
      <div className="backgroundImgDiv">
        <h1>I'm Daniel!</h1>
        <h2>A blockchain and react enthusiast!</h2>
        <img src={blockChainIcon} alt="blockchain icon" className="imgBlock" />
        <img src={appIcon} alt="application icon" />
        <img src={blockChainIcon} alt="blockchain icon" />
      </div>

      <span className="span1">Background Picture</span>
      <span className="span2">Background Picture</span>
      <span className="span3">Background Picture</span>
    </>
  );
}

export default IntroImage
